import "./Issue.css";
import Avatar from "../Avatar/Avatar";
import PriorityLabel from "../PriorityLabel/PriorityLabel";
import CategoryLabel from "../CategoryLabel/CategoryLabel";
import classNames from "classnames";

function Issue(props) {
  return (
    <div classNames={classNames("issue", props.selected ? "active" : undefined)}>
      <PriorityLabel priority={props.priority} />
      <a href={props.link}>{props.id}</a>
      <div className="issue-title">{props.title}</div>
      <CategoryLabel name="User Interface" />
      <Avatar></Avatar>
    </div>
  );
}

export default Issue;
